1. Local Variables: These are declared inside a function and are only accessible within that function. They are created and destroyed each time the function is called.

2. Global Variables: These are declared outside any function and are accessible from any part of the program. They are created when the program starts and destroyed when the program ends.

3. Static Variables: These are a combination of local and global variables. They are declared inside a function but have a property similar to global variables. They are created only once when the program starts and retain their value between function calls.

